import { Card } from "@mui/material";
import './musicplay.css'
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';

const MusicPlay = () => {
  return (
    <>
      <div className="card_box">
        <Card>
          <FavoriteBorderIcon sx={{marginLeft:"auto"}}/>
        </Card>
      </div>
    </>
  )
}
export default MusicPlay;
